import './StyleFooter.css';
export const Footer = () => {
    return(
        <footer className="flex justify-center items-center flex-col p-4" style={{backgroundColor: '#4F4F4F', color: '#FFFFFF'}}>
            <h2 className='main-footer-text'>Thank you for being here, I hope that I've helped you with the solutions presented, please, consider connecting with me using the links bellow:</h2>
            <div class="flex p-4">
                <a href="https://www.instagram.com/juannaugusto/"><i className="icon-instagram"></i></a>
                <i className="icon-facebook2"><a href="https://www.facebook.com/juan.augusto.7169"></a></i>
                <i className="icon-youtube"><a href="https://www.youtube.com/channel/UCO_mBpadEe467FAJjNQWD1g"></a></i>
                <i className="icon-linkedin"><a href="https://www.linkedin.com/in/juan-soares-881877177/"></a></i>
                <i className="icon-github"><a href="https://github.com/Juan-Augusto"></a></i>

            </div>

        </footer>
    );
}
